CREATE TABLE `user` (
  `User_ID` int DEFAULT NULL,
  `F_Name` varchar(50) NOT NULL,
  `L_Name` varchar(50) NOT NULL,
  `Gender` varchar(15) NOT NULL,
  `DOB` date NOT NULL,
