  KEY `boarding_pass_id` (`boarding_pass_id`),
  CONSTRAINT `user_ibfk_1` FOREIGN KEY (`Flight_no`) REFERENCES `flight` (`Flight_no`),
  CONSTRAINT `user_ibfk_2` FOREIGN KEY (`PNR_No`) REFERENCES `ticket` (`PNR_No`),
  CONSTRAINT `user_ibfk_3` FOREIGN KEY (`Transaction_ID`) REFERENCES `payment` (`Transaction_ID`),
